
public class ExampleApp {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x,y,z,m;
		x= 10;
		y=5;
		z=16;
		m=++x - --y + z++;
		System.out.println("z=" +z);
		System.out.println("y=" +y);
		System.out.println("x=" +x);
		System.out.println("m=" +m);

	}

}
